import React, { Component } from "react";
import "./index.css";
import canvas from "./keramik-kursus-1.jpeg";

class Top extends React.Component {
  render() {
    return (
      <div>
        <div className="nav-link">
          <a href="http://172.16.3.120:3000/" rel="home">
            <span class="logo">Lh</span>
            <span class="logotext">Unika-Keramik</span>
          </a>
        </div>
        <div class="container-top">
          <img src={canvas} class="intro" />
          <h1 class="slide-right">Lise Høg Keramik</h1>
        </div>
        <div class="profile">
            <div class="user"></div>
            <div class="usertext">Hej jeg hedder Nima Badiei Høg<br/><br/>
            Jeg er datatekniker programmering<br/><br/>
            Jeg spiller pro CSGO og er top 1 Faceit<br/><br/>
            Har mange bitches</div>
        </div>
      </div>
    );
  }
}

export default Top;
